import React from 'react'

import { Card, Form } from 'react-bootstrap';

const Register = () => {
    return (
        <Card className="border">
            <Card.Header style={{ fontSize: '2rem', fontWeight: 'bold' }}>Registration</Card.Header>
            <Card.Body>
                <Form>
                </Form>
            </Card.Body>
        </Card>
    )
}

export default Register
